                    double min = int.MaxValue;
                    int w = 0;
                    for (int u = 0; u < Size; u++)
                    {
                        if (nov[u] && min > d[u])
                        {
                            min = d[u];
                            w = u;
                        }
                    }

                    nov[w] = false; //–ø–æ–º–µ—â–∞–µ–º w –≤ –º–Ω–æ–∂–µ—Å—Ç–≤–æ S
                                    //–¥–ª—è –∫–∞–∂–¥–æ–π –≤–µ—Ä—à–∏–Ω—ã –∏–∑ –º–Ω–æ–∂–µ—Å—Ç–≤–∞ V\S –æ–ø—Ä–µ–¥–µ–ª—è–µ–º –∫—Ä–∞—Ç—á–∞–π—à–∏–π –ø—É—Ç—å –æ—Ç
                                    // –∏—Å—Ç–æ—á–Ω–∏–∫–∞ –¥–æ —ç—Ç–æ–π –≤–µ—Ä—à–∏–Ω—ã
                    for (int u = 0; u < Size; u++)
                    {
                        double distance = d[w] + array[w, u];
                        if (nov[u] && d[u] > distance && array[w, u] != 0)
                        {
                            d[u] = distance;
                            p[u] = w;
                        }
                    }
                }
                return d; //–≤ –∫–∞—á–µ—Å—Ç–≤–µ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞ –≤–æ–∑–≤—Ä–∞—â–∞–µ–º –º–∞—Å—Å–∏–≤ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π –¥–ª—è
            } 
            //–∑–∞–¥–∞–Ω–Ω–æ–≥–æ –∏—Å—Ç–æ—á–Ω–∏–∫–∞
            //–≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏ –æ—Ç –≤–µ—Ä—à–∏–Ω—ã a –¥–æ –≤–µ—Ä—à–∏–Ω—ã b –¥–ª—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –î–µ–π–∫—Å—Ç—Ä—ã
            //public void WayDijkstr(int a, int b, double[] p, ref Stack items)
            //{
            //    items.Push(b); //–ø–æ–º–µ—â–∞–µ–º –≤–µ—Ä—à–∏–Ω—É b –≤ —Å—Ç–µ–∫
            //    if (a == p[b]) //–µ—Å–ª–∏ –ø—Ä–µ–¥—ã–¥—É—â–µ–π –¥–ª—è –≤–µ—Ä—à–∏–Ω—ã b —è–≤–ª—è–µ—Ç—Å—è –≤–µ—Ä—à–∏–Ω–∞ –∞, —Ç–æ
            //    {
            //        items.Push(a); //–ø–æ–º–µ—â–∞–µ–º –∞ –≤ —Å—Ç–µ–∫ –∏ –∑–∞–≤–µ—Ä—à–∞–µ–º –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏
            //    }
            //    else //–∏–Ω–∞—á–µ –º–µ—Ç–æ–¥ —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤—ã–∑—ã–≤–∞–µ—Ç —Å–∞–º —Å–µ–±—è –¥–ª—è –ø–æ–∏—Å–∫–∞ –ø—É—Ç–∏
            //    { //–æ—Ç –≤–µ—Ä—à–∏–Ω—ã –∞ –¥–æ –≤–µ—Ä—à–∏–Ω—ã, –ø—Ä–µ–¥—à–µ—Å—Ç–≤—É—é—â–µ–π –≤–µ—Ä—à–∏–Ω–µ b
            //        WayDijkstr(a, p[b], p, ref items);
            //    }
            //}

            //—Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –§–ª–æ–π–¥–∞
            public double[,] Floyd(out int[,] p)
            {
                int i, j, k;
                //—Å–æ–∑–¥–∞–µ–º –º–∞—Å—Å–∏–≤—ã —Ä –∏ –∞
                double[,] a = new double[Size, Size];
                p = new int[Size, Size];
                for (i = 0; i < Size; i++)
                {
                    for (j = 0; j < Size; j++)
                    {
                        if (i == j)
                        {
                            a[i, j] = 0;
                        }
                        else
                        {
                            if (array[i, j] == 0)
                            {
                                a[i, j] = int.MaxValue;
                            }
                            else
                            {
                                a[i, j] = array[i, j];
                            }
                        }
                        p[i, j] = -1;
                    }
                }
                //–æ—Å—É—â–µ—Å—Ç–≤–ª—è–µ–º –ø–æ–∏—Å–∫ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π
                for (k = 0; k < Size; k++)
                {
                    for (i = 0; i < Size; i++)
                    {
                        for (j = 0; j < Size; j++)
                        {
                            double distance = a[i, k] + a[k, j];
                            if (a[i, j] > distance)
                            {
                                a[i, j] = distance;
                                p[i, j] = k;
                            }
                        }
                    }
                }
                return a;//–≤ –∫–∞—á–µ—Å—Ç–≤–µ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞ –≤–æ–∑–≤—Ä–∞—â–∞–µ–º –º–∞—Å—Å–∏–≤ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π –º–µ–∂–¥—É
            }

            //–≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏ –æ—Ç –≤–µ—Ä—à–∏–Ω—ã a –¥–æ –≤–µ—Ä—à–∏–Ω—ã –≤ –¥–ª—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –§–ª–æ–π–¥–∞
            public void WayFloyd(int a, int b, int[,] p, ref Queue items)
            {
                int k = p[a, b];
                //–µ—Å–ª–∏ k<> -1, —Ç–æ –ø—É—Ç—å —Å–æ—Å—Ç–æ–∏—Ç –±–æ–ª–µ–µ —á–µ–º –∏–∑ –¥–≤—É—Ö –≤–µ—Ä—à–∏–Ω –∞ –∏ b, –∏ –ø—Ä–æ—Ö–æ–¥–∏—Ç —á–µ—Ä–µ–∑
                //–≤–µ—Ä—à–∏–Ω—É k, –ø–æ—ç—Ç–æ–º—É
                if (k != -1)
                {
                    // —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤–æ—Å—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –ø—É—Ç—å –º–µ–∂–¥—É –≤–µ—Ä—à–∏–Ω–∞–º–∏ –∞ –∏ k
                    WayFloyd(a, k, p, ref items);
                    items.Add(k); //–ø–æ–º–µ—â–∞–µ–º –≤–µ—Ä—à–∏–Ω—É –∫ –≤ –æ—á–µ—Ä–µ–¥—å
                                  // —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤–æ—Å—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –ø—É—Ç—å –º–µ–∂–¥—É –≤–µ—Ä—à–∏–Ω–∞–º–∏ k –∏ b
                    WayFloyd(k, b, p, ref items);
                }
            }
        } 
        
        //–∫–æ–Ω–µ—Ü –≤–ª–æ–∂–µ–Ω–Ω–æ–≥–æ –∫–ª–∞c—Å–∞
        private Node graph; //–∑–∞–∫—Ä—ã—Ç–æ–µ –ø–æ–ª–µ, —Ä–µ–∞–ª–∏–∑—É—é—â–µ–µ –ê–¢–î ¬´–≥—Ä–∞—Ñ¬ª
        private List<GorodaOnline> l;
        public Graph(string name) //–∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –≤–Ω–µ—à–Ω–µ–≥–æ –∫–ª–∞—Å—Å–∞
        {
            using (StreamReader file = new StreamReader(name))
            {
                int n = int.Parse(file.ReadLine());
                l = new List<GorodaOnline>();
                for (int i = 0; i<n; i++)
                {
                    string line = file.ReadLine();
                    string[] mas = line.Split(' ');
                    l.Add(new GorodaOnline(mas[0], int.Parse(mas[1]), int.Parse(mas[2])));
                }

                double[,] a = new double[n, n];
                for (int i = 0; i < n; i++)
                {
                    string line = file.ReadLine();
                    string[] mas = line.Split(' ');
                    for (int j = 0; j < n; j++)
                    {
                        int b = int.Parse(mas[j]);
                        a[i, j] = l[i].Distance(l[j]) * b;
                    }
                }
                graph = new Node(a);
            }
        }
        //–º–µ—Ç–æ–¥ –≤—ã–≤–æ–¥–∏—Ç –º–∞—Ç—Ä–∏—Ü—É —Å–º–µ–∂–Ω–æ—Å—Ç–∏ –Ω–∞ –∫–æ–Ω—Å–æ–ª—å–Ω–æ–µ –æ–∫–Ω–æ
        public void Show()
        {
            foreach(GorodaOnline gorod in l)
            {
                Console.WriteLine(gorod);
            }
            for (int i = 0; i < graph.Size; i++)
            {
                for (int j = 0; j < graph.Size; j++)
                {
                    if (graph[i, j] == 0)
                    {
                        Console.Write("{0}\t", graph[i, j]);
                    }
                    else
                    {
                        Console.Write("{0:f2}\t", graph[i, j]);
                    }
                }
                Console.WriteLine();
            }
        }
