        {
            graph.NovSet();//–ø–æ–º–µ—á–∞–µ–º –≤—Å–µ –≤–µ—Ä—à–∏–Ω—ã –≥—Ä–∞—Ñ–∞ –∫–∞–∫ –Ω–µ–ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–Ω—ã–µ
            graph.Dfs(v); //–∑–∞–ø—É—Å–∫–∞–µ–º –∞–ª–≥–æ—Ä–∏—Ç–º –æ–±—Ö–æ–¥–∞ –≥—Ä–∞—Ñ–∞ –≤ –≥–ª—É–±–∏–Ω—É
